import React from "react";
import { Text, View } from "react-native";

const ShopScreen = ({ navigation }) => {
  return (
    <View
      title
      style={{ flex: 1, alignItems: "center", justifyContent: "center" }}>
      <Text>Shop Screen</Text>
    </View>
  );
};

export default ShopScreen;
